import React from "react";
import "../App.css";
import "../css/Projects.css";
import { makeStyles, createStyles, Theme } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Grid from "@material-ui/core/Grid";

const projectsStyles = makeStyles((theme: Theme) =>
  createStyles({
    root: {
      flexGrow: 1
    },
    icon: {
      padding: theme.spacing(10),
      textAlign: "center",
      color: theme.palette.text.secondary
    }
  })
);

function Projects() {
  const projectsStyle = projectsStyles();

  return (
    <div id="projects" className="background-color-gray menu-top-padding">
      <div>
        <p className="menu-name">PROJECTS</p>
      </div>
      <Grid container spacing={2}>
        <Grid item xs={6} sm={3} md={2}>
          <Paper className={projectsStyle.icon}></Paper>
        </Grid>
      </Grid>
    </div>
  );
}

export default Projects;
